(40, 29, '无上神帝', 'Supreme God Emperor', 'wushangshendi', 'wushangshendi', 'https://banana.xpornkit.com/upload/covers/2025/12/29/2b6e9ed93ee311c558a58bc3c140bb47.jpg', '', '溪林,忻子约,关帅,冷泉夜月,季骜杰,钟巍,烈之流星,蘭雨馨,张妮,徐翔,Akira明,柳知萧', '项方', '', '2020', '大陆', '国语', 0.0, 0, 0, 0, 0, 0, 0, '更新至第556集', '　　万年之前，仙王牧云因持有诛仙图而遭人暗算，残魂沉睡万年之后，在天运大陆南云帝国有名的“废物牧云”身上觉醒。牧云初醒，就受到了学生妙仙语的刻意刁难，牧云轻松的就化解了妙仙语的陷阱，并举一反三的说出了更多的炼丹技巧，让门外的炼丹大师莫问赏识不已。回到家中，牧云得知了要与秦家小姐秦梦瑶结亲的消息。秦梦瑶寒毒在身，活不过二十岁，结亲不过是为了牧家和秦家的利益。但牧林辰的劝说下，牧云以炼丹为条件，答应了这门亲事。炼出了淬骨丹，牧云的修为有了第一次提升。莫问时常来找牧云请教，而秦时雨一直想请莫问来治疗孙女秦梦瑶。莫问暗示让牧云一试，牧云阴差阳错下唤醒了体内的诛仙图，得知秦梦瑶体内的并非寒毒，而是冰凰神魄。牧云治好了秦梦瑶，冰凰神魄的力量使得秦梦瑶修为突飞猛进。在见识到了牧云的能力后，秦梦瑶对牧云充满了好奇和兴趣，于是成为了北云学院的导师，和牧云教导同一个班级。而追求秦梦瑶不成的东方玉，嫉妒仇恨之心燃起，誓与牧云势不两立。 牧云借着诛仙图突破修为，去北云山脉历练，妙仙语执意同行，途中牧云以一人之力猎杀十几头紫毛猎狼，让妙仙语十分震惊。而被人指派暗杀幕运动柳山四煞一路尾随，趁牧云脱力之机会，纷纷现身准备对牧云下手。', 'liangzi$$$lzm3u8', '第01集$https://vip.lz-cdn14.com/share/af5afd7f7c807171981d443ad4f4f648#第02集$https://vip.lz-cdn14.com/share/7e1d842d0f7ee600116ffc6b2d87d83f#第03集$https://vip.lz-cdn14.com/share/95d309f0b035d97f69902e7972c2b2e6#第04集$https://vip.lz-cdn14.com/share/ed4227734ed75d343320b6a5fd16ce57#第05集$https://vip.lz-cdn14.com/share/dc5c768b5dc76a084531934b34601977#第06集$https://vip.lz-cdn14.com/share/88a199611ac2b85bd3f76e8ee7e55650#第07集$https://vip.lz-cdn14.com/share/b710915795b9e9c02cf10d6d2bdb688c#第08集$https://vip.lz-cdn14.com/share/277281aada22045c03945dcb2ca6f2ec#第09集$https://vip.lz-cdn14.com/share/228499b55310264a8ea0e27b6e7c6ab6#第10集$https://vip.lz-cdn14.com/share/076023edc9187cf1ac1f1163470e479a#第11集$https://vip.lz-cdn14.com/share/49af6c4e558a7569d80eee2e035e2bd7#第12集$https://vip.lz-cdn14.com/share/8f19793b2671094e63a15ab883d50137#第13集$https://vip.lz-cdn14.com/share/894b77f805bd94d292574c38c5d628d5#第14集$https://vip.lz-cdn14.com/share/5129a5ddcd0dcd755232baa04c231698#第15集$https://vip.lz-cdn14.com/share/bcb41ccdc4363c6848a1d760f26c28a0#第16集$https://vip.lz-cdn14.com/share/dca5672ff3444c7e997aa9a2c4eb2094#第17集$https://vip.lz-cdn14.com/share/d72fbbccd9fe64c3a14f85d225a046f4#第18集$h